import React from "react";
import "./style.css";

function CardChoices(props) {
  return (

        <div className="col-3">
            <div className="card" onClick={props.imageClick}>
                <img src={props.image} className="card-img-top" alt={props.name}/>
            </div>
        </div>

  );
}

export default CardChoices;
